+import * as React from 'react';
+
+// material-ui
+import Card from '@mui/material/Card';
+import CardContent from '@mui/material/CardContent';
+import CardMedia from '@mui/material/CardMedia';
+import Typography from '@mui/material/Typography';
+import { CardActionArea, Grid, Stack, Avatar } from '@mui/material';
+import Box from '@mui/material/Box';
+import Tabs from '@mui/material/Tabs';
+import Tab from '@mui/material/Tab';
+import Paper from '@mui/material/Paper';
+import SwipeableViews from 'react-swipeable-views';
+
+// assets import
+import bg_profile from 'assets/images/bg/bg-profile.jpeg';
+import avatar1 from 'assets/images/users/avatar-jack.jpg';
+
+// project import
+import MainCard from 'components/MainCard';
+import TabOne from './user-tab/TabOne';
+import TabTwo from './user-tab/TabTwo';
+import TabThree from './user-tab/TabThree';
+
+// ==============================|| Edit Profile PAGE ||============================== //
+const user = JSON.parse(localStorage.getItem('user'));
+
+function TabPanel(props) {
+    const { children, value, index, ...other } = props;
+
+    return (
+        <div role="tabpanel" hidden={value !== index} id={`simple-tabpanel-${index}`} aria-labelledby={`simple-tab-${index}`} {...other}>
+            {value === index && (
+                <Box sx={{ p: 3 }}>
+                    <Typography>{children}</Typography>
+                </Box>
+            )}
+        </div>
+    );
+}
+
+const EditProfile = () => {
+    const [tabcount, setTabcount] = React.useState(0);
+
+    const handleChange = (event, newValue) => {
+        setTabcount(newValue);
+    };
+    return (
+        <>
+            <MainCard title="Edit Profile">
+                <Card sx={{ maxWidth: '100%', bgcolor: '#efebe9' }}>
+                    <CardActionArea>
+                        <CardMedia component="img" height="140" image={bg_profile} alt="green iguana" />
+                        <CardContent>
+                            <CardContent sx={{ px: 2.5, pt: 3 }}>
+                                <Grid container justifyContent="space-between" alignItems="center">
+                                    <Grid item>
+                                        <Stack direction="row" spacing={1.25} alignItems="center">
+                                            <Avatar alt="profile user" src={avatar1} sx={{ width: 100, height: 100 }} />
+                                            <Stack>
+                                                <Typography variant="h4" color="#4e342e">
+                                                    {user.firstName + ' ' + user.lastName}
+                                                </Typography>
+                                                <Typography variant="subtitle1" color="#8d6e63">
+                                                    {user.userEmail}
+                                                </Typography>
+                                                <Typography variant="body2" color="textSecondary">
+                                                    UI/UX Designer
+                                                </Typography>
+                                            </Stack>
+                                        </Stack>
+                                    </Grid>
+                                </Grid>
+                            </CardContent>
+                        </CardContent>
+                    </CardActionArea>
+                </Card>
+                <Paper sx={{ maxWidth: '100%', mt: 3 }}>
+                    <Card>
+                        <CardContent>
+                            <SwipeableViews index={tabcount} onChangeIndex={handleChange}>
+                                <TabPanel value={tabcount} index={0}>
+                                    <TabOne></TabOne>
+                                </TabPanel>
+                                <TabPanel value={tabcount} index={1}>
+                                    <TabTwo></TabTwo>
+                                </TabPanel>
+                                <TabPanel value={tabcount} index={2}>
+                                    <TabThree></TabThree>
+                                </TabPanel>
+                            </SwipeableViews>
+                        </CardContent>
+                    </Card>
+                </Paper>
+            </MainCard>
+        </>
+    );
+};
+
+export default EditProfile;

